function Glue(_dti_ar)
{


var curr_big_line = _dti_ar[0].xyz_dti
var curr_add_line = _dti_ar[1].xyz_dti

var big_line_min_ind = 0
var big_line_max_ind = 0
var add_line_min_ind = 0
var add_line_max_ind = 0
var maxdist = -999999
var mindist = 999999

for (var i = 0; i < curr_big_line.length/3 - 1; i++) {
for (var j = 0; j < curr_add_line.length/3 - 1; j++) {
	var dist_ij = (curr_big_line[i*3] - curr_add_line[j*3])*(curr_big_line[i*3] - curr_add_line[j*3])+(curr_big_line[i*3+1] - curr_add_line[j*3+1])*(curr_big_line[i*3+1] - curr_add_line[j*3+1])+(curr_big_line[i*3+2] - curr_add_line[j*3+2])*(curr_big_line[i*3+2] - curr_add_line[j*3+2])
	if (mindist > dist_ij) {
		mindist = dist_ij
		big_line_min_ind = i
		add_line_min_ind = j
	}
	if (maxdist < dist_ij) {
		maxdist = dist_ij
		big_line_max_ind = i
		add_line_max_ind = j
	}
}}

var new_curr_big_line = []
if (big_line_max_ind < big_line_min_ind) {
for (var i = 0; i < big_line_min_ind + 1; i++) {
new_curr_big_line.push(curr_big_line[i*3])
new_curr_big_line.push(curr_big_line[i*3+1])
new_curr_big_line.push(curr_big_line[i*3+2])
}
} else {
for (var i = curr_big_line.length/3-1; i > big_line_min_ind + 1; i = i - 1 ) {
new_curr_big_line.push(curr_big_line[i*3])
new_curr_big_line.push(curr_big_line[i*3+1])
new_curr_big_line.push(curr_big_line[i*3+2])
}
}


if (add_line_max_ind > add_line_min_ind) {
for (var i = add_line_min_ind; i < curr_add_line.length/3-1; i++) {
new_curr_big_line.push(curr_add_line[i*3])
new_curr_big_line.push(curr_add_line[i*3+1])
new_curr_big_line.push(curr_add_line[i*3+2])
}
} else {

for (var i = add_line_min_ind + 1; i > -1; i = i - 1 ) {
new_curr_big_line.push(curr_add_line[i*3])
new_curr_big_line.push(curr_add_line[i*3+1])
new_curr_big_line.push(curr_add_line[i*3+2])
}
}


var ret = {xyz_dti:new_curr_big_line}

ret.xyz_dti.push(_dti.xyz_dti[i*3])
ret.xyz_dti.push(MidpointY-_dti.xyz_dti[i*3+1])
ret.xyz_dti.push(_dti.xyz_dti[i*3+2])
}*/
///console.log("GLLLLLLLLLLLLLLLL",ret)
DTI.push(ret)
return DTI[DTI.length-1]

function MakeHexSymbol(_dec) {
	if (_dec == 10) {return "a"}
	if (_dec == 11) {return "b"}
	if (_dec == 12) {return "c"}
	if (_dec == 13) {return "d"}
	if (_dec == 14) {return "e"}
	if (_dec == 15) {return "f"}
	return _dec
}
function MakeHex(_dec) {
	var FirstVal = String(MakeHexSymbol(Math.floor(_dec*255/16)))
	var SecondVal = String(MakeHexSymbol(Math.floor(_dec*255-Math.floor(_dec*255/16)*16)))
	return FirstVal+SecondVal
}

	if (_rgb) {return "#"+MakeHex(_rgb.r)+MakeHex(_rgb.g)+MakeHex(_rgb.b) ; }
	else {return "#000000"}
}

function GetLayerArea(_CurrSomaLayer) {
	var CurrLengthAtLayer = 0
	for (var eachcluster in _CurrSomaLayer) { 
		for (var eachline in _CurrSomaLayer[eachcluster]) { 
			for (var i = 0 ; i< _CurrSomaLayer[eachcluster][eachline].xyz.length-1 ; i++) {
				var currxyz1 = _CurrSomaLayer[eachcluster][eachline].xyz[i]
				var currxyz2 = _CurrSomaLayer[eachcluster][eachline].xyz[i+1]
				var CurrCutDist = GetDistXYZ(currxyz1, currxyz2)
				CurrLengthAtLayer = CurrLengthAtLayer + CurrCutDist
			}
		}
	}
///console.log("fff", CurrLengthAtLayer,_CurrSomaLayer)
	return CurrLengthAtLayer
}














function GetDistXYZ(currxyz1, currxyz2) {
	return Math.sqrt(((currxyz1[0]-currxyz2[0])*(currxyz1[0]-currxyz2[0]))+((currxyz1[1]-currxyz2[1])*(currxyz1[1]-currxyz2[1]))+((currxyz1[2]-currxyz2[2])*(currxyz1[2]-currxyz2[2]))) ; 
}

var _currproportion = (_LengthAtLayer - CurrLengthAtLayer)/CurrCutDist

					return ret ; /// currxyz1 ; 
				}

			}
		}
	}
	return ret
}

function FindDistFromPointToCut(_point,_xyz1,_xyz2,_numind) {
///console.log("kkkkkk",_point,_xyz1,_xyz2)

/*
(_xyz1[0]-lxa)/lxb = (_xyz1[1]-lya)/lyb = (_xyz1[2]-lza)/lzb
(_xyz2[0]-lxa)/lxb = (_xyz2[1]-lya)/lyb = (_xyz2[2]-lza)/lzb

*/
//param line equation
	var lxb = _xyz2[0] - _xyz1[0]
	var lyb = _xyz2[1] - _xyz1[1]
	var lzb = _xyz2[2] - _xyz1[2]
	var lxa = _xyz1[0]
	var lya = _xyz1[1]
	var lza = _xyz1[2]
	var td = (lxb*_point[0]+lyb*_point[1]+lzb*_point[2]-lxb*lxa-lyb*lya-lzb*lza)/(lxb*lxb+lyb*lyb+lzb*lzb)
	var _projection_point = [lxb*td+lxa,lyb*td+lya,lzb*td+lza]

	var _isprojectionpointinsidecut = 1
	var _xmin = _xyz1[0]
	var _xmax = _xyz2[0]
	if (_xyz1[0] > _xyz2[0]) {
		_xmin = _xyz2[0]
		_xmax = _xyz1[0]
	}
	var _ymin = _xyz1[1]
	var _ymax = _xyz2[1]
	if (_xyz1[1] > _xyz2[1]) {
		_ymin = _xyz2[1]
		_ymax = _xyz1[1]
	}
	var _zmin = _xyz1[2]
	var _zmax = _xyz2[2]
	if (_xyz1[2] > _xyz2[2]) {
		_zmin = _xyz2[2]
		_zmax = _xyz1[2]
	}
	if ((_projection_point[0] < _xmin) || (_projection_point[0] > _xmax) || (_projection_point[1] < _ymin) || (_projection_point[1] > _ymax) || (_projection_point[2] < _zmin) || (_projection_point[2] > _zmax)) {_isprojectionpointinsidecut = 0}

	var distpoint1 = (_xyz1[0]-_point[0])*(_xyz1[0]-_point[0])+(_xyz1[1]-_point[1])*(_xyz1[1]-_point[1])+(_xyz1[2]-_point[2])*(_xyz1[2]-_point[2])
	var distpoint2 = (_xyz2[0]-_point[0])*(_xyz2[0]-_point[0])+(_xyz2[1]-_point[1])*(_xyz2[1]-_point[1])+(_xyz2[2]-_point[2])*(_xyz2[2]-_point[2])
	var distpointproj = (_projection_point[0]-_point[0])*(_projection_point[0]-_point[0])+(_projection_point[1]-_point[1])*(_projection_point[1]-_point[1])+(_projection_point[2]-_point[2])*(_projection_point[2]-_point[2])
	var _mindist = distpoint1 ; 
	var _minind = _numind ; 
	var _mincoord = _xyz1 ; 
	if (distpoint1 > distpoint2) {
		_mindist = distpoint2 ;
		_minind = _numind + 1 ; 
		_mincoord = _xyz2 ; 
	}
	if (_isprojectionpointinsidecut == 1) {
		if (distpointproj < _mindist) {
			_mindist = distpointproj ;
			_mincoord = _projection_point ; 
		}
	}

	return {dist:_mindist, closestpointxyz:_mincoord,numind:_minind}
}
function GetLineAnalysis(_line,_begxyz,_endxyz, _coverLegth) {
///console.log("lll",_line,_begxyz,_endxyz)
	var _begdist = 999999 ; 
	var _enddist = 999999 ; 
	var _begind = 0 ; 
	var _endind = 0 ; 
	///_begxyz = [0,0,0] ; 
	///_endxyz = [0,0,0] ; 
var _begxyz2
var _endxyz2
	for (var i = 0; i < _line.xyz.length - 1; i++) {
		var _currbegdist = FindDistFromPointToCut(_begxyz,_line.xyz[i],_line.xyz[i+1],i) ; 
		var _currenddist = FindDistFromPointToCut(_endxyz,_line.xyz[i],_line.xyz[i+1],i) ; 
		if (_currbegdist.dist < _begdist) {
			_begdist = _currbegdist.dist
			_begind = _currbegdist.numind /// i + 1 ;
			_begxyz2 = _currbegdist.closestpointxyz ;
		}
		if (_currenddist.dist < _enddist) {
			_enddist = _currenddist.dist
			_endind = _currenddist.numind /// i + 1 ;
			_endxyz2 = _currenddist.closestpointxyz ;
		}
///console.log("NNN",i,_currbegdist,_currenddist)
	}
///console.log(_endxyz)	
if (_endxyz == 0) {
if ( _coverLegth > 0) {
_endind = _line.xyz.length-1
_enddist = 0 ; 
_endxyz2 = _line.xyz[_line.xyz.length - 1]
} else {
_endind = 0
_enddist = 0 ; 
_endxyz2 = _line.xyz[0]
} 
}
///console.log("TOO BIG DISTANCE BUG", _begdist+_enddist, _line,_begxyz,_endxyz, _coverLegth)
	return {begenddist:_begdist+_enddist,begpoint:{begxyz:_begxyz2,begind:_begind},endpoint:{endxyz:_endxyz2,endind:_endind}}
}
 

function getCutLength(_xyz1,_xyz2) {
	return Math.sqrt((_xyz2[0]-_xyz1[0])*(_xyz2[0]-_xyz1[0])+(_xyz2[1]-_xyz1[1])*(_xyz2[1]-_xyz1[1])+(_xyz2[2]-_xyz1[2])*(_xyz2[2]-_xyz1[2]))
}

	_k = 1
	if (_cutlen != 0) {_k = _len/_cutlen}

	return ret
}
